import React from "react";
import "./Predict.scss";
function Predict() {
  return (
    <div className="predictContainer">
      <div>
        <div className="predictHead">당신의 신용등급은?</div>
        <div className="predictSub">
          정보를 입력하면 신용등급을 예측해드립니다!
        </div>
      </div>
    </div>
  );
}

export default Predict;
